import React from "react";
import "./index.css";
const keep_image = "./src/images/keep_images.png";

function Header(){
    return (
        <div className="header">
          <img src={keep_image} alt="keep_images"/>
          <a href="#">Keep</a>
        </div>
    );
}
export default Header;
